.nav__link:hover {
  color: #fce48b;
}

.nav__link:after {
  content: "";
  display: block;
  background-color: #fce48b;
  width: 100%;
  height: 3px;

  position: absolute;
  top: 100%;
  left: 0;
  z-index: 1;

  opacity: 0;

  transition: opacity 0.9s linear;  
}

.nav__link:hover:after,
.nav__link.active:after {
  opacity: 1;
}

/*Nav toggle*/

.nav-toggle {
  width: 30px;
  padding: 10px 0;
/*скрыть текст Menu*/
  font-size: 0;
  color: transparent;
/*убрать стили кнопки*/
  border: 0;
  background: none;

  cursor: pointer;
  /*скрыть меню*/
  display: none;

  position: absolute;
  top: 24px;
  right: 24px;
  z-index: 1;
}

.nav-toggle:focus {
  outline: 0;
}

.nav-toggle__item {
  display: block;
  width: 100%;
  height: 3px;
  background-color: #fff;
/*позиционируем по центру*/
  position: absolute;
  top: 0;
  right: 0;
  left: 0;
  bottom: 0;
  margin: auto;

  transition: background .2s linear;
}

.nav-toggle__item:before,
.nav-toggle__item:after {
  content: "";
  width: 100%;
  height: 3px;
  background-color: #fff;

  position: absolute;
  left: 0;
  z-index: 1;

  transition: transform .2s linear;
}

.nav-toggle__item:before {
  top: -8px;
}

.nav-toggle__item:after{
  bottom: -8px;
}

/*если active,то убрать фон*/
.nav-toggle.active .nav-toggle__item {
  background: none;
}

.nav-toggle.active .nav-toggle__item:before {
  transform-origin: left top;
  transform: rotate(45deg) translateX(-2px) 
}

.nav-toggle.active .nav-toggle__item:after {
  transform-origin:  left bottom;
  transform: rotate(-45deg) translateX(-3px)
}


