body {
  margin: 0;
  font-size: 15px;
  font-family: "Montserrat", sans-serif;
  color: #333333;
  line-height: 1.6;
  background: #fff;
}

*,
*:before,
*:after {
  box-sizing: border-box;
}

h1,
h2,
h3,
h4,
h5,
h6 {
  margin: 0;
}

hr {
  border: 0;
  display: block;
  width: 100%;
  height: 1px;
  margin: 40px 0;
  background-color: #e5e5e5;
}

.page {
  /*убрать полосу за iphone*/
  overflow: hidden;
}

.container {
  width: 100%;
  max-width: 1230px;
  padding: 0 15px;
  margin: 0 auto;
}

/*Header*/

.header {
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
  z-index: 1000;
  width: 100%;
  padding-top: 30px;
}

.header.fixed {
  padding: 10px 0;
  background-color: #eb8b8d;
  
  position: fixed;
  top: 0px;
  right: 0;
  left: 0;
/*меню не дёргается при скроле*/
  transform: translate3d(0, 0, 0);

  box-shadow: 0 3px 10px rgba(0, 0, 0, 0.3);
}

.header.active {
  background-color: #eb8b8d;
}

.header__inner {
  display: flex;
  justify-content: space-between;
  align-items: center;
}

.header__logo {
  font-size: 30px;
  font-weight: 700;
  color: #fff;  
}

.nav { 
  font-size: 14px;
  text-transform: uppercase;  
}

.nav__link {  
  display: inline-block;
  vertical-align: top;
  margin: 0 15px;
  color: #fff;
  text-decoration: none;

  transition: color .2s linear;
  
  position: relative;
}

.nav__link.active {
  color: #fce48b;
}

.nav__link:hover {
  color: #fce48b;
}

.nav__link:after {
  content: "";
  display: block;
  background-color: #fce48b;
  width: 100%;
  height: 3px;

  position: absolute;
  top: 100%;
  left: 0;
  z-index: 1;

  opacity: 0;

  transition: opacity 0.9s linear;  
}

.nav__link:hover:after,
.nav__link.active:after {
  opacity: 1;
}

/*Nav toggle*/

.nav-toggle {
  width: 30px;
  padding: 10px 0;
/*скрыть текст Menu*/
  font-size: 0;
  color: transparent;
/*убрать стили кнопки*/
  border: 0;
  background: none;

  cursor: pointer;
  /*скрыть меню*/
  display: none;

  position: absolute;
  top: 24px;
  right: 24px;
  z-index: 1;
}

.nav-toggle:focus {
  outline: 0;
}

.nav-toggle__item {
  display: block;
  width: 100%;
  height: 3px;
  background-color: #fff;
/*позиционируем по центру*/
  position: absolute;
  top: 0;
  right: 0;
  left: 0;
  bottom: 0;
  margin: auto;

  transition: background .2s linear;
}

.nav-toggle__item:before,
.nav-toggle__item:after {
  content: "";
  width: 100%;
  height: 3px;
  background-color: #fff;

  position: absolute;
  left: 0;
  z-index: 1;

  transition: transform .2s linear;
}

.nav-toggle__item:before {
  top: -8px;
}

.nav-toggle__item:after{
  bottom: -8px;
}

/*если active,то убрать фон*/
.nav-toggle.active .nav-toggle__item {
  background: none;
}

.nav-toggle.active .nav-toggle__item:before {
  transform-origin: left top;
  transform: rotate(45deg) translateX(-2px) 
}

.nav-toggle.active .nav-toggle__item:after {
  transform-origin:  left bottom;
  transform: rotate(-45deg) translateX(-3px)
}


.intro {
  background: url("../images/intro.jpg") center no-repeat;
  background-size: cover;
  width: 100%;
  height: 100vh;
  /*фиксирует слайдер и не даёт двигаться вверх img*/
  min-height: 820px;
  position: relative;

  display: flex;
  flex-direction: column;
  justify-content: center;
}

.intro__inner {
  width: 100%;
  max-width: 880px;
  margin: 0 auto;
  text-align: center;
}

.intro__suptitle {
  font-family: "Kaushan Script", cursive;
  font-size: 72px;
  color: #fff;
  margin-bottom: 75px;
}

.intro__title {
  color: #fff;
  font-size: 150px;
  font-weight: 700;
  text-transform: uppercase;
  line-height: 1;
}

.intro__title:after {
  content: "";
  display: block;
  background-color: #fff;
  width: 60px;
  height: 3px;
  margin: 60px auto;
}

.btn {
  display: inline-block;
  padding: 8px 30px;
  margin-bottom: 60px;
  border: 3px solid #fff;
  vertical-align: top;
  color: #fff;
  text-transform: uppercase;
  font-size: 14px;
  font-weight: 700;
  text-decoration: none;
  transition: background 0.2s linear, color 0.2s linear;
}

.btn:hover {
