  color: #333;
}

.slider {
  width: 100%;
  position: absolute;
  bottom: 0px;
  left: 0px;
  z-index: 1;
}

.slider__inner {
  display: flex;
  justify-content: space-between;
}

.slider__item {
  width: 23%;
  color: #fff;
  font-size: 18px;
  text-transform: uppercase;
  border-top: 3px solid;
  padding: 25px 0;
  opacity: 0.7;

  position: relative;
}

.slider__num {
  font-size: 24px;
  font-weight: 700;
}

.slider__item.active {
  opacity: 1;
}

.slider__item.active:before {
  content: "";
  display: block;
  width: 70px;
  height: 3px;
  background-color: #f38181;

  position: absolute;
  top: -3px;
  left: 0px;
  z-index: 1;
}



.section {
  padding: 80px 0;
  
}

.section--devices {
  background: url("../images/devices-bg.jpg") no-repeat center;
  background-size: cover;
  padding-bottom: 0;
  margin-bottom: 40px;
}

.section--gray {
  background-color: #f8f8f8;
}

.section--clients{
  background: #f4f4f4 
  url("../images/clients-bg.jpg")
  center no-repeat;
  background-size: cover;
}

.section--map {
  background: #e6e6e6 
  url("../images/map-bg.jpg")
  center no-repeat;
  background-size: cover;
  padding: 50px 0;
}

.section__header {
  width: 100%;
  max-width: 950px;
  margin: 0 auto 50px;
  text-align: center;
}

.section__suptitle {
  font-size: 24px;
  font-family: "Kaushan Script", cursive;
  color: #363636;
}

.section__title {
  font-size: 30px;
  color: #363636;
  font-weight: 700;
  text-transform: uppercase;
}

.section__title:after {
  content: "";
  display: block;
  background: #d98080;
  width: 60px;
  height: 3px;
  margin: 40px auto 50px;
}

.section__text {
  color: #989898;
  font-size: 15px;
  font-family: 'Roboto', sans-serif;
}

/*Card*/

.card {
  display: flex;
  flex-wrap: wrap;
  justify-content: space-between;
  margin: 80px -15px 0;
}

.card__item {
  width: 33.33333%; 
  padding: 0 15px;
}

.card__inner {
  background: #aee0d2;
  position: relative;
}

.card__inner:hover .card__img img {
  opacity: 0.1;
}

.card__inner:hover .card__img {
  transform: translate3d(-10px, -10px, 0);
}

.card__inner:hover .card__text {
  opacity: 1;
}

.card__img img {
  /*равнение по высоте img*/
  display: block; 
  /*не вылезали за пределы блока*/
  max-width: 100%;
  height: auto;
  
  transition: opacity 0.9s linear;
}

.card__img {
  background: linear-gradient(to bottom, #d98080, #f5e28e);
  transition: transform 0.9s linear;
}

.card__text {
  font-size: 18px;
  font-weight: 700;
  text-transform: uppercase;
  color: #fff;
  text-align: center;

  position: absolute;
  top: 50%;
  right: 0;
  z-index: 2;
  transform: translate3d(0, -50%, 0);
  width: 100%;
  opacity: 0;

  transition: opacity 0.5s ease-in-out;
}

.card__info {
  margin-top: 20px;
  text-align: center;
}

.card__name {
  text-transform: uppercase;
  font-size: 14px;
  color: #333;
}

.card__prof {
  font-family: 'Roboto', sans-serif;
  font-style: italic;
  font-weight: 300;
  font-size: 15px;
  color: #999999;
}

.social {
  display: flex;
  justify-content: center;
}

.social__item {
  width: 55px;
  height: 55px;
  background-color: #fce38a;
  border-right: 1px solid #f38181;
  text-decoration: none;
  color: #f38181;
  font-size: 30px;
  padding: 12px 10px;
  line-height: 1;
  transition: background 0.9s ease-in,
  color 0.9s ease-in;
}

.social__item:last-child {
  border-right: 0px;
}

.social__item:hover {
  background-color: #f38181;
  color: #fff;
}

/*Statistics*/

.statistics {
  background: #95e1d3;
}

.stat {
  display: flex;
  flex-wrap: wrap;
}

.stat__item {
  flex: 1 1 0; /*выровнять на равные блоки без отступов*/
