  color: #fff;
  text-align: center;
  padding: 70px 25px;
}

.stat__item:last-child {
  border-right: 1px solid #c6e9e0;
}

.stat__count {
  font-size: 72px;
  font-weight: 700;
  line-height: 1;
  margin-bottom: 10px;
}

.stat__text {
  font-size: 14px;
  text-transform: uppercase;
}

/*Services*/

.services {
  display: flex;
  flex-wrap: wrap;
}

.services__item {
  width: 33.33333%;
  padding: 0 25px 40px 85px;
  
  position: relative;
  margin-bottom: 40px;
}

.services__item--border {
  border-bottom: 1px solid #e5e5e5;
}

.services__icon {
  position: absolute;
  top: 3px;
  left: 25px;
  z-index: 1;
}

.services__title {
  font-size: 14px;
  text-transform: uppercase;
  color: #333;
  margin-bottom: 10px;
}

.services__text {
  font-size: 15px;
  color: #999;
}

/*Devices*/

.devices {
  width: 100%;
  max-width: 610px;
  margin: 0 auto;
  position: relative;
}

.devices__item {
  display: block;
  /*уменьшить img по ширине*/
  max-width: 100%;
  height: auto;
}

.devices__item--iphone {
  position: absolute;
  bottom: -80px;
  right: 0px;
  z-index: 1;
}

/*We do*/

.wedo {
  display: flex;
  flex-wrap: wrap;
  margin: 0 -15px;
}

.wedo__item {
  width: 50%;
  padding: 0 15px;
}

.wedo__img {
  display: block;
  max-width: 100%;
  height: auto;
}

.accordion__item {
  border: 1px solid #e5e5e5;
  margin-bottom: 10px;
}

/*Если .accordion__item с классом active
показываем .accordion__content*/
.accordion__item.active  
.accordion__content{
  display: block;
}

.accordion__item.active 
.accordion__header:after {
  transform: translateY(-50%) rotate(-45deg);
  margin-top: 5px;
}

.accordion__item.active 
.accordion__header {
  border-bottom-color: #e5e5e5;
}

.accordion__header {
  border-bottom: 1px solid transparent;
  padding: 15px 20px 15px 65px;
  position: relative;
  cursor: pointer;
}

.accordion__header:after {
  content: "";
  display: block;
  width: 16px;
  height: 16px;
  border-top: 2px solid #cccccc;
  border-right: 2px solid #cccccc;

  position: absolute;
  right: 20px;
  top: 50%;
  transform: translateY(-50%) rotate(135deg);
  z-index: 1;
}

.accordion__icon {
  position: absolute;
  top: 50%;
  left: 20px;
  z-index: 1;
  transform: translateY(-50%);
}

.accordion__content {
  padding: 15px 20px;
  font-size: 15px;
  color: #999;
  font-style: italic;
  font-weight: 300;
  display: none;
}

.accordion__title {
  font-size: 14px;
  color: #333;
  text-transform: uppercase;
}

/*Reviews*/

.reviews {  
  position: relative;
}

.reviews  .slick-slider {
  padding: 0 110px;
}

.reviews__item {
  min-height: 210px;
  padding-left: 255px;
  position: relative;
 
}

.reviews__photo {
  /*поставить фото по центру*/
  display: block;

  width: 210px;
  height: 210px;
  
  position: absolute;
  top: 0px;
  left: 0px;
  z-index: 1;
  border: 2px solid #95e1d3;
  border-radius: 50%;
}

.reviews__avatar {
  position: absolute;
  top: 0px;
  left: 0px;
  z-index: 1;

  color: #95e1d3;
  font-size: 60px;
  width: 150px;
  height: 150px;
  border: 3px solid #95e1d3;
  text-align: center;
  line-height: 150px;
}

.reviews__text {
  font-size: 24px;
  font-style: italic;
  font-weight: 300;
  color: #999999;
  margin-bottom: 15px;
}

.reviews__author {
  font-size: 24px;
  color: #333333;
  font-family: "Kaushan Script", cursive;
}

.reviews__author:before {
  content: "";
  display: inline-block;
  width: 60px;
  height: 3px;
  background: #f38181;
  vertical-align: middle;
  margin-right: 10px;
}

.slick-arrow {
  display: block;
  color: transparent;
  font-size: 0;

  border: 0;
  background: none;

  position: absolute;
  top: 50%;
  transform: translateY(-50%);
  z-index: 1;

  cursor: pointer;
}

.slick-arrow:focus {
  outline: 0;
}

.slick-arrow:after {
  content: "";
  display: block;
  width: 16px;
  height: 16px;
  border-top: 2px solid #cccccc;
  border-left: 2px solid #cccccc;
}

.slick-prev {
  left: 25px;
  top: 65px;
  transform: rotate(-45deg);
  
}

.reviews__btn--next,
.slick-next {
  right: 25px;
  top: 65px;
  transform: rotate(135deg);
}

/*Logos*/

.logos {
  display: flex;
  justify-content: space-between;
  align-items: center;
  margin: 0 -15px;
}

.logos__item {
  padding:  0 15px;
}

.logos__img {
  display: block;
  max-width: 100%;
  height: auto;
}

/*Works*/

.works {
  display: flex;
}

.works__col {
  flex: 1 1 0;
}

.works__item {
  position: relative;
  background: linear-gradient(to bottom, #d98080, #f5e28e);
}

/*при наводе на works__item  у
works__image  уменьшим opacity,
затемним картинку*/
.works__item:hover .works__image {
  opacity: 0.1;
}
/*при на воде на works__item
покажем works__info*/
.works__item:hover .works__info {
  opacity: 1;
}

.works__image {
  transition: opacity 0.2s linear;
  display: block;
  max-width: 100%;
  height: auto;
}

.works__info {
  width: 100%;
  position: absolute;
  top: 50%;
  transform: translate3d(0, -50%, 0);
  left: 0;
  z-index: 1;

  text-align: center;
  color: #fff;
  padding: 0 15px;
  
  opacity: 0;
  transition: opacity 1.9s linear;
}

.works__title {
  font-size: 14px;
  text-transform: uppercase;
  margin-bottom: 5px;
}

.works__text {
  font-size: 15px;
  font-style: italic;
  font-weight: 300;
}

/*Clients*/

.clients {
  display: flex;
  flex-wrap: wrap;
  margin-top: 70px;
}

.clients__item {
  width: 50%;
  padding: 0 45px 0 175px;
  position: relative;
  margin-bottom: 75px;
}

.clients__photo {
  width: 110px;
  height: 110px;

  border-radius: 50%;

  position: absolute;
  top: 0px;
  left: 40px;
  z-index: 1;
}

.clients__name {
  font-size: 14px;
  color: #333;
  text-transform: uppercase;
  margin-bottom: 5px;
}

.clients__prof {
  font-size: 15px;
  font-style: italic;
  font-weight: 300;
  color: #333;
  font-family: 'Roboto', sans-serif;
}

.clients__text {
  font-size: 15px;
  color: #999;
  font-family: 'Roboto', sans-serif;
}

.clients__text:before {
  content: "";
  display: block;
  width: 60px;
  height: 3px;
  background-color: #f38181;
  margin: 15px 0;
}

/*Blog*/

.blog {
  display: flex;
  flex-wrap: wrap;
  justify-content: space-between;
}

.blog__item {
  width: 32%;
}

.blog__header {
  position: relative;
  margin-bottom: 14px;
}

.blog__photo {
  /*ровняем по высоте фото*/
