  font-size: 30px;
  font-weight: 700;
  font-style: normal;
  line-height: 1;
}

.blog__content {
  margin-bottom: 14px;
}

.blog__title {
  font-size: 14px;
  color: #333333;
  text-transform: uppercase;
  margin-bottom: 10px;
}

.blog__title a {
  color: inherit;
  text-decoration: none;
}

.blog__title a:hover {
