  margin-right: 10px;
}

.blog-stat__item i {
  color: #95e1d3;
  padding-right: 5px;
}

/*Map*/

.map {
  text-align: center;
}

.map__title {
  color: #f38181;
  font-size: 24px;
  font-weight: 700;
  text-transform: uppercase;
}

.map__title:after {
  content: "";
  display: block;
  width: 60px;
  height: 3px;
  background-color: #f38181;
  margin: 20px auto ;
}

.map__title a {
  color: inherit;
  text-decoration: none;
}

.map__title a:hover {
  text-decoration: underline;
}

/*Footer*/

.footer {
